import React, {useState} from 'react'

export default function devList({ github_username, techs, bio, avatar_url, name }) {
    const [link, setLink] = useState(``)
    setLink(`https://github.com/${github_username}`)
    return (
        <li className="dev-item">
            <header>
              <img src={avatar_url} alt={github_username}/>
              <div className="user-info">
                <strong>{name}</strong>
                <span>{techs}</span>
              </div>
            </header>
            <p>
              {bio}
            </p>
            <a href={link}>View this profile</a>
          </li>
    )
}
